import React from 'react'
import './styles.css'
import logo from '../../assets/logo.svg'

const CreatePoint = () => {

    return (
        <div id="Page-Create-Point">
            <header>
                <img src={logo} alt="E-coleta" />
            </header>            
        </div>
    )
}

export default CreatePoint
